pragma solidity ^0.8.9;




interface IUniswapV2Router01 {
    function addLiquidity(
        address tokenA,
        address tokenB,
        uint amountADesired,
        uint amountBDesired,
        uint amountAMin,
        uint amountBMin,
        address to,
        uint deadline
    ) external returns (uint amountA, uint amountB, uint liquidity);

    function swapExactTokensForTokensSupportingFeeOnTransferTokens(
        uint256 amountIn,
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external;
}

contract TTDAOLiquidityProfit is Ownable {
    using SafeMath for uint256;

    address public  ttDaoAddress = address(0);
    address public  lpAddress;
    address private constant _usdtAddress = 0x55d398326f99059fF775485246999027B3197955;
    address private constant _swapAddress = 0x10ED43C718714eb63d5aA57B78B54704E256024E;
    uint256 public  constant MAX = ~uint256(0);
    uint256 public  constant DAY_SEC = 86400;

    struct StakeData {
        uint256 stakeLp;
        uint256 stakeTime;
        uint256 claimedTTDAO;
        uint256 lastClaimTime;
    }

    struct LPData {
        address lpAddress;
        uint256 pancakeLpbalance;
    }

    mapping(address => StakeData) public balances;
    mapping(uint256 => uint256) public lpDailySupply;
    mapping(uint256 => uint256) public lpDailyReward;

    uint256 public lastBalance = 0;

    function stake(uint256 amount) public {
        update();
        IERC20(lpAddress).transferFrom(msg.sender, address(this), amount);
        StakeData storage user = balances[msg.sender];
        require(user.stakeLp == 0, "stake once");

        user.stakeLp = amount;
        user.stakeTime = block.timestamp;
        user.lastClaimTime = block.timestamp;
    }

    function claim(bool withdraw) public {
        update();

        StakeData storage user = balances[msg.sender];
        require(user.stakeLp > 0, "no stake");
        require(block.timestamp > user.lastClaimTime + DAY_SEC, "wait");
        uint256 ttDaoBalance = 0;
        uint256 currentIndex = block.timestamp / DAY_SEC;
        for (uint256 i = user.lastClaimTime / DAY_SEC; i < currentIndex; ++i) {
            if (lpDailySupply[i] > 0) {
                uint256 reward = lpDailyReward[i] * (user.stakeLp) / lpDailySupply[i];
                ttDaoBalance = ttDaoBalance.add(reward);
            }
        }

        if (ttDaoBalance > 0) {
            user.lastClaimTime = block.timestamp;
            user.claimedTTDAO = user.claimedTTDAO.add(ttDaoBalance);

            address[] memory path = new address[](2);
            path[0] = ttDaoAddress;
            path[1] = _usdtAddress;
            IUniswapV2Router01 router = IUniswapV2Router01(_swapAddress);
            router.swapExactTokensForTokensSupportingFeeOnTransferTokens(
                ttDaoBalance,
                0,
                path,
                msg.sender,
                block.timestamp
            );

            lastBalance = IERC20(ttDaoAddress).balanceOf(address(this));
        }

        if (withdraw) {
            IERC20(lpAddress).transfer(msg.sender, user.stakeLp);
            user.stakeLp = 0;
            user.stakeTime = 0;
            user.lastClaimTime = 0;
        }
    }

    function update() public {
        uint256 currentBalance = IERC20(ttDaoAddress).balanceOf(address(this));
        if (currentBalance > lastBalance) {
            uint256 currentIndex = block.timestamp / DAY_SEC;
            lpDailyReward[currentIndex] = lpDailyReward[currentIndex].add(currentBalance - lastBalance);
            lpDailySupply[currentIndex] = IERC20(lpAddress).totalSupply();
        }
        lastBalance = currentBalance;
    }

    function setAddress(address ttDaoAddr, address lpAddr) public onlyOwner {
        ttDaoAddress = ttDaoAddr;
        lpAddress = lpAddr;
        IERC20(ttDaoAddress).approve(_swapAddress, MAX);
    }

    function canStake(address account) public view returns (bool stakePancakeLp) {
        StakeData memory user = balances[account];
        stakePancakeLp = user.stakeLp == 0 ? true : false;
    }

    function getAccountInfo(address account) public view returns (StakeData memory stakeData, LPData memory lpData, uint256 availableAmount) {
        stakeData = balances[account];
        lpData.lpAddress = lpAddress;
        lpData.pancakeLpbalance = IERC20(lpAddress).balanceOf(account);

        if (stakeData.stakeLp == 0) {
            availableAmount == 0;
        } else {
            uint256 currentIndex = block.timestamp / DAY_SEC;
            for (uint256 i = stakeData.lastClaimTime / DAY_SEC; i < currentIndex; ++i) {
                if (lpDailySupply[i] > 0) {
                    uint256 reward = lpDailyReward[i] * stakeData.stakeLp / lpDailySupply[i];
                    availableAmount = availableAmount.add(reward);
                }
            }
        }
    }

    function getLpDaily(uint256 dayIndex) public view returns (uint256, uint256) {
        return (lpDailyReward[dayIndex], lpDailySupply[dayIndex]);
    }
}
